        $this->insert('{{%manufacturer}}',['id'=>'1','title'=>'Agoprofil','alias'=>'Agoprofil','imageID'=>'5620','body'=>'<h1 style=\"text-align: justify;\">Традиции и инновации</h1>
<div style=\"text-align: justify;\">Популярная мебельная фабрика AGOPROFIL ведет коммерческую деятельность с далекого 1972 года. Из них на российском рынке марка присутствует 10 лет, и за этот срок она успела полюбиться множеству покупателей. Свою деятельность AGOPROFIL начинала с изготовления классических итальянских дверей из дерева. Со временем старые ремесленные традиции были не просто сохранены, но скомбинированы с различными современными способами производства и дизайна. Сегодня фабрика специализируется на межкомнатных дверях.</div>
<div style=\"text-align: justify;\"> </div>
<h3 style=\"text-align: justify;\">Какие преимущества таят в себе двери AGOPROFIL?</h3>
<ul>
    <li style=\"text-align: justify;\"> Классический стиль, сочетающий в себе прошлое, настоящее и будущее;</li>
    <li style=\"text-align: justify;\"> Инновационный подход, гарантирующие оптимальные технические характеристики и максимальное удобство монтажа;</li>
    <li style=\"text-align: justify;\"> Разнообразие моделей, подходящих как для жилых, так и для офисных помещений;</li>
    <li style=\"text-align: justify;\"> Узнаваемый дизайн, нарочитая простота форм и удивительно долгий срок службы.</li>
</ul>
<div style=\"text-align: justify;\">Помимо этого, сегодня AGOPROFIL имеет собственное проектное бюро, где очень  чутко реагируют на желания потребителей.</div>
<div style=\"text-align: justify;\">Компания имеет особый сертификат системы качества UNI EN ISO 9001. Это не просто признак того, что предприятию можно доверять, но еще и доказательство способности фабрики гибко реагировать на изменения потребностей рынка. Сертификат свидетельствует о грамотном проектировании и разработке индивидуальных архитектурных решений.</div>
<div style=\"text-align: justify;\">В любой серии дверей, выпускаемых фабрикой, есть модели, сделанные из шпона, из массива и с сотовым наполнением. AGOPROFIL изготавливает и все виды дверных аксессуаров. Сами двери изготавливают в нескольких основных вариантах: распашные, раздвижные двери, и «книжки».</div>
<div style=\"text-align: justify;\">Оформление двери может быть практически любым: от строгой классики до дверей с позолотой, ручной росписью и прочими атрибутами премиум-класса.</div>
<div style=\"text-align: justify;\"> </div>
<h3 style=\"text-align: justify;\">Чтобы было проще найти нужное вам среди всего изобилия моделей, кратко расскажем о каждой серии дверей от AGOPROFIL:</h3>
<ul>
    <li style=\"text-align: justify;\">Серия Class характеризуется строгим классическим дизайном. Двери изготавливаются из древесины.</li>
    <li style=\"text-align: justify;\">Crystal можно расшифровать как кристальную чистоту в оформлении. Количество украшений на деревянных дверях этой серии минимально.</li>
    <li style=\"text-align: justify;\">Diamond изготавливается из шпона. Двери этой серии отличаются наличием матовых стекол.</li>
    <li style=\"text-align: justify;\">Double round похож на серию Diamond, только стеклянные вставки здесь более широкие и напоминают небольшие окна.</li>
    <li style=\"text-align: justify;\">Elegance характеризуется массивными косяками. В дизайне присутствуют овальные вставки из матового стекла.</li>
    <li style=\"text-align: justify;\">Fun отличается яркой расцветкой дверей и создана специально для тех, кто хочет бросить вызов скучной повседневности.</li>
</ul>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей AGOPROFIL.</div>','website'=>'http://www.agoprofil.com/ru/','brandID'=>'5','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-01_agoprofil']);
        $this->insert('{{%manufacturer}}',['id'=>'2','title'=>'Astor Mobili','alias'=>'Astor-Mobili','imageID'=>'5613','body'=>'<p style=\"text-align: justify;\">Основанная в 1961 году в Италии фабрика Astor Mobili за более чем 50-летнюю историю всегда оказывалась одной из первых, кто развивал новые технологии и не боялся отказываться от пережившего свое время дизайна. Именно поэтому продукция фабрики Astor Mobili пользуется популярностью у ценителей современных интерьеров. В дизайне дверей этого производителя нет ничего лишнего, но, в то же время, каждая из них имеет собственный неповторимый стиль. Строгость металла, легкость стекла и благородство дерева воплощаются в фантазиях дизайнера в лаконичные и изящные коллекции. Это сочетается с высоким качеством всех материалов и фурнитуры.</p>
<div style=\"text-align: justify;\">Astor Mobili предлагает серии распашных, складных и раздвижных дверей с коробкой и каркасом из алюминия и дерева, решения для высоких помещений, перегородки, а также особый тип дверей – открывающиеся стены.</div>
<h4><br />
Алюминий</h4>
<div style=\"text-align: justify;\">Четыре серии, четыре неповторимых коллекции, притягивающих взгляды своей лаконичностью и ультрасовременным дизайном. Коробка и каркас двери выполнены из высокопрочного алюминия серебристого или пепельного цвета. Прозрачное, закаленное или травленое стекло может быть украшено декоративными элементами: легкими штрихами, ритмичными полосками, рассыпными горошинами или утонченной каллиграфией.</div>
<div style=\"text-align: justify;\">Для придания ощущения тепла и домашнего уюта используются вставки и панели из цельной древесины или шпона. Богатство расцветок достигается широким выбором деревянных панелей, а также лака, которым может быть покрыто дерево или стекло. Серии Atlantic и Next отличаются особой утонченностью и легкостью, Xila – домашним уютом, а Gemini – деловой солидностью.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Древесина</h4>
<div style=\"text-align: justify;\">При производстве дверей 12 серий, объединенных производителем в общую группу «древесина», используется не только дерево. В отдельных сериях каркас и коробка выполнены из алюминия, скрытого деревянными панелями. Разумное сочетание надежности, легкости и прочности конструкции с благородным внешним видом позволило компании Astor Mobili завоевать любовь дизайнеров всего мира.</div>
<div style=\"text-align: justify;\">Створки дверей серий Сalypso, Duel, Flap, Line и Piana цельные. Что, впрочем, не помешало производителю изящно украсить серию Calipso вставками из плексигласа, а серию Line – ритмичным рисунком из алюминиевых вставок по всей ширине полотна.</div>
<div style=\"text-align: justify;\">Стекло и древесина гармонично сочетаются в сериях Clever, Firma и Tekno. В отделке моделей серии Clever этот союз дополняется широкими кожаными полотнами.</div>
<div style=\"text-align: justify;\">На передний план стекло выходит в сериях Maja, Opera, Plaza и Twin. Решетчатые двери серии Maja подчеркнуто легкомысленны. В сериях Opera и Plaza стеклянные вставки выполнены более строгими прямоугольниками. Серия Twin – цельное стеклянное полотно, окаймленное профилированной панелью, скрытой под шпоном.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Открывающиеся стены</h4>
<div style=\"text-align: justify;\">Уникальная конструкция раздвижных и распашных дверей – собственная запатентованная разработка фабрики Astor Mobili. Идеальное решение для зонирования и реорганизации пространства жилого помещения или офиса. Открывающиеся стены позволяют в одно мгновение объединить две комнаты в единую залу или наоборот отделить зону отдыха, гостиную, пространство для ведения переговоров.</div>
<div style=\"text-align: justify;\">Двери серии Bridge отличаются раздвижной конструкцией, а Meeting – особым решением, когда одна створка играет роль «обычной» двери, а вторая – распашной стены.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Решения для высоких помещений</h4>
<div style=\"text-align: justify;\">Модели серии Wing – это интересное развитие концепции открывающихся стен. Высота таких дверей равна высоте потолка, но их ширина, а значит и требование к свободному для открывания пространству, – как у обычной межкомнатной двери.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Перегородки и панели</h4>
<div style=\"text-align: justify;\">Если вам близка по духу идея оформления интерьера ширмами из цельного листа стекла, строго обрамленного металлическим профилем или деревянной панелью, то серия перегородок Screen позволит вам воплотить самые смелые фантазии. Надежная конструкция проста в установке и универсальна.</div>
<div style=\"text-align: justify;\">А для оформления отдельных зон обратите внимание на серии стеновых панелей Area 48, Delta, Sticker и Matrix. Их главная особенность – функциональные элементы, полки, вешалки, зеркала, которые оставляют широкий простор как с точки зрения удобства использования, так и с точки зрения дизайна интерьера.</div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Astor Mobili.</div>','website'=>'http://www.astor.it/','brandID'=>'4','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-02_astor']);
        $this->insert('{{%manufacturer}}',['id'=>'3','title'=>'Bosca','alias'=>'Bosca','imageID'=>'5641','body'=>'<p>Основанная в 1968 году в Италии семейная столярная мастерская братьев Скапин превратилась в завод Bosсa Arredi, занимающий площадь в 5 тысяч квадратных метров. На фабрике трудятся три десятка человек, включая учредителей, лично следящих за производственным процессом. И если когда-то Bosсa выполняла нехитрые заказы жителей ближайших домов, то сейчас три четверти продукции завода отправляются на экспорт в западную Европу, США и Россию.</p>
<div>Продукция Bosсa ценится дизайнерскими и архитектурными студиями, строительными организациями и дверными салонами. На базе завода работает собственное проектное бюро. Создавая уникальный дизайн и расширяя гамму цветовых решений, Bosсa не забывает и про совершенствование технологии. Компания стремится к балансу между разнообразием модельного ряда, качеством производства, вниманием к деталям и простотой монтажа. Именно в поиске этого идеального сочетания фабрика видит свою миссию.</div>
<div>Продукция завода представлена тремя коллекциями: Exit, Entry и Light, каждая из которой насчитывает не менее девяти моделей, не считая разнообразия цветовых решений и декоративного оформления. Помимо дверей, Bosсa предлагает систему хранения Flexis.</div>
<div>Материалы, которые использует Bosсa, традиционны – алюминий, дерево, шпон и 4-6-миллиметровое стекло. Невооруженным взглядом заметна любовь дизайнеров компании к металлу, как к легкой, надежной и универсальной основе для создания своих шедевров. Для отделки дверей всех серий используется шпон таких пород, как клен, бамбук, вишня, орех, палисандр, дуб, венге. А стекло может быть прозрачным, молочно-белым, бронзовым, дымчатым или цветным.</div>
<div> </div>
<h4>Exit</h4>
<div>Коллекция из девяти моделей разработана дизайнером Stipiti Laterali. Хотя каждая дверь коллекции по-своему уникальна, все они объединены идеей ритмичного горизонтального или вертикального рисунка. Игра с чередованием стекла и деревянных панелей создает ощущение легкости и непринужденности.</div>
<div> </div>
<h4>Entry</h4>
<div>Модели этой коллекции идеологически повторяют серию Exit, но отличаются большей сдержанностью и строгостью. Если двери Exit создают домашний уют, то Entry скорее настраивают на деловой лад. Функциональность и качество выступают на первый план, оставляя этим дверям роль последних штрихов, но не доминант интерьера.</div>
<div> </div>
<h4>Light</h4>
<div>Серия Light стала «визитной карточкой» фабрики Bosсa. Это воплощение минимализма и совершенства. Название серии как нельзя лучше подчеркивает эту идею. Абсолютизм достигнут в моделях Light Plus, Light Universal и Light Minimal. Они справедливо заслужили собственное имя, а не порядковый номер в каталоге. Цельная стеклянная панель и ничего лишнего. Казалось бы, предельно просто, но на самом деле, это весьма смелый дизайнерский шаг.</div>
<div>Двери серии Light пользуются глубокой симпатией не только у тех, кто ценит функциональность, облаченную в простые формы. Богатство расцветок, стекла и декоративных элементов оставляют дизайнерам широких простор для фантазии, по сути, предлагая создать собственное решение с чистого листа на базе высококачественных и зарекомендовавших себя с лучшей стороны составных частей.</div>
<div> </div>
<h4>Flexis</h4>
<div>Сначала кажется несколько странным, что компания, чье имя во всем мире ассоциируется именно с дверьми, решилась на создание собственной системы хранения. Но в этом есть глубокий смысл. Серия Flexis – это не еще одно направление производства, а тонкий имиджевый ход. Фабрика Bosсa изящно демонстрирует, что она способна на большее, чем производство дверей, но выбирает это направление осознанно, так как видит в нем свое предназначение.</div>
<div>Что касается самой системы хранения, она выполнена в лучших традициях фабрики и идеально сочетается с раздвижными дверями Bosko, позволяя вписать в интерьер вместительный шкаф или отделить просторную гардеробную.</div>
<div>Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Bosca.</div>','website'=>'http://www.boscaarredi.it/','brandID'=>'1','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-03_bosca']);
        $this->insert('{{%manufacturer}}',['id'=>'4','title'=>'Casali','alias'=>'Casali','imageID'=>'5639','body'=>'<p style=\"text-align: justify;\">Дизайнеры итальянской фабрики Casali превращают обычное стекло в нечто новое. Они смело пресекают границы традиционного представления об обработке материала, к которому с трепетом относились во все времена. Создание произведений мастерами Casali сродни живописи, только вместо холста используется стеклянное полотно. Тот же неограниченный простор для фантазии, тот же поиск вдохновения и та же непредсказуемость результата. Именно так художники по стеклу создают шедевры Casali, поражающие ценителей изысканных интерьеров.</p>
<div style=\"text-align: justify;\">Сотрудничая с проектировщиками, дизайнерами и архитекторами более тридцати лет, компания дала рождение ряду технологичных решений в области оформления интерьеров стеклянными полотнами. Прозрачность стекла и игра декоративных элементов позволяют разделить помещения, сохранив единство пространства. Двери Casali не стоят на пути света, они пропускают его через фильтр фантазии мастера, создавая неповторимую атмосферу легкой изысканности.</div>
<div style=\"text-align: justify;\">Огромный опыт обработки стекла позволяет Casali сочетать изящность этого материала с функциональностью и надежностью. Едва заметные соединительные элементы из полированной нержавеющей стали и лаконичная фурнитура – это собственные разработки компании. Двери Casali отвечают нормам безопасности, стандартам надежности и качества. Подчеркивая, что произведения безупречны не только внешне, но и функционально, компания разделят модели не по сериям, а по функциональному назначению.</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">Plane Solutions</h4>
<div style=\"text-align: justify;\">Под скромным заголовком, который можно перевести как «решения на плоскости» Casali скрывает свои львиную долю своего ассортимента. Здесь собраны двери, полотна которых – это цельный лист стекла. Распашные и раздвижные одно- и двуполотные модели отличаются декоративным оформлением и фурнитурой. В оформлении отдельных дверей, помимо стекла и металла, используется шпон для отделки дверной коробки.</div>
<div style=\"text-align: justify;\">Помимо стандартных решений для сдвижных дверей, когда механизм прячется за верхней кулисой или внутри дверного проема, Casali предлагает смелое решение, получившее называние System. В дверях System механизм не прячется, а наоборот открыто демонстрируется. Металлическая штанга крепится над дверным проемом, а дверь фиксируется на двух роликах. Развитием этой идеи стал механизм System Zero, когда штанга частично скрывается верхним полотном самой двери.</div>
<div style=\"text-align: justify;\">Еще одна находка Casali – стеклянные раздвижные ширмы. Конструкция состоит из четырех полотен. Два полотна – непосредственно двери, а еще два – прозрачные стены. Пожалуй, это лучшее подтверждение того, что мастера фабрики умеют играть со светом, пропуская его через матовые стекла и декор и превращая эту игру в элемент интерьера.</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">Soluzioni Curve</h4>
<div style=\"text-align: justify;\">Особое решение от фабрики Casali – двери с изогнутым полотном. В серии доступны распашные и раздвижные модели, включая двери с открытым механизмом System. Эти модели решают проблему организации дверного проема в изогнутых стенах, позволяя архитекторам смело использовать радиальные перегородки для организации пространства.</div>
<div style=\"text-align: justify;\">Colorate и Bi-Color</div>
<div style=\"text-align: justify;\">Отдавая дань минималистичным решениям, Casali создала серии одноцветных и двуцветных дверных полотен. Такие двери ведут двойную игру со светом: светящийся сочным оттенком дверной проем претендует на роль доминанты интерьера, а мягкое пастельное отражение на полу оттеняет яркость цветового пятна.</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">I Miti</h4>
<div style=\"text-align: justify;\">Четыре черно-белых полотна, четыре гравюры, четыре образа погружают нас в атмосферу пятидесятых. Элвис Пресли, Одри Хепберн, Мэрилин Монро и Джеймс Дин увековечены в серии, название которой переводится как «Мифы».</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">Strutture</h4>
<div style=\"text-align: justify;\">Огромный опыт работы с цельными стеклянными полотнами позволяет фабрике заниматься не только дверьми. Речь идет о серии сборных стеклянных конструкций, которые могут использоваться для оформления выставочных стендов, торговых площадей, офисных помещений и даже жилого пространства. Прозрачные или цветные стеклянные полотна, в том числе изогнутые, соединяются между собой надежными элементами из нержавеющей стали. Универсальность конструкции оставляет огромный простор для дизайнерской фантазии, позволяя конструировать структуры разных форм и разного назначения.</div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Casali.</div>','website'=>'http://www.casali.net/','brandID'=>'23','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-04_casali']);
        $this->insert('{{%manufacturer}}',['id'=>'5','title'=>'Comas','alias'=>'Comas','imageID'=>'5803','body'=>'<p style=\"text-align: justify;\">Основанная в 1976 году итальянская деревообрабатывающая фабрика Comas на протяжении многих лет хранит лучшие традиции работы с массивом дерева, совмещая их с новейшими технологиями в области производства дверей, перегородок, мебели и других элементов интерьера.</p>
<div style=\"text-align: justify;\">Хотя сегодня Comas – это полноценное мебельное производство, владельцам фабрики удалось сохранить обаяние небольшой столярной мастерской, где могли бы плечо к плечу трудиться отец со своим сыном. Каждое изделие, созданное в стенах этого предприятия, хранит тепло ручной работы и привносит в дом счастливого обладателя гармонию тихого семейного уюта. Дух маленькой мастерской подчеркивается и индивидуальным подходом к каждому заказу. Comas учитывает пожелания частных покупателей, создавая предметы под конкретные проекты. Такая гибкость справедливо заявляется компанией, как основное преимущество.</div>
<div style=\"text-align: justify;\">Немногие заводы такого формата позволяют себе вкладываться в разработки, предпочитая работать по чужим технологиям или использовать проверенные десятилетиями конструкции. Но Comas не пытается сэкономить на развитии, перенимая лучший мировой опыт и используя собственные решения в области производства дверей и мебели. Профессионализм работников фабрики обеспечивает стабильно высокое качество. Именно поэтому с Comas сотрудничают магазины, бары, рестораны, банки и даже государственные учреждения Италии, а продукция завода популярна далеко за пределами страны.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Межкомнатные раздвижные двери</h4>
<div style=\"text-align: justify;\">Одно из основных направлений фабрики – межкомнатные раздвижные двери и перегородки из массива дуба, сосны, вишни, ясеня, груши и ореха. Ценные породы дерева сочетаются со стеклом, рисовой бумагой, японской тканью из конопляного волокна и другими натуральными материалами. Хотя Италию и страны дальнего востока отделяют тысячи километров, японские мотивы особенно проявляются в лаконичных решетчатых формах дверей.</div>
<div style=\"text-align: justify;\">Модели раздвижных дверей отличаются сортами дерева и дополнительными материалами. Темная порода в гармонии с матовым стеклом несет идею монументальности. Такие двери хорошо подчеркивают строгие интерьерные решения. Древесина светлых оттенков, дополненная неокрашенной тканью, лучше подходит для создания ощущения легкости и беззаботности. Зеркальные вставки увеличивают пространство, а прозрачное стекло предельно деликатно разделяет комнаты, сохраняя единство помещения.</div>
<div style=\"text-align: justify;\">Для ценителей нестандартных решений все многообразие сочетаний материалов и форм доступно в серии радиусных раздвижных дверей. Тоже натуральное дерево, стекло или ткань, но особая изогнутая форма и конструкция, позволяющая двери плавно и мягко скользить по стене или убираться в нее.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Решетчатые панели и другая продукция</h4>
<div style=\"text-align: justify;\">Универсальный материал для оформления пространства Comas скромно называет  «деревянными решетками». На практике эти панели находят самое широкое применение, начиная от декоративных ширм, заканчивая отделкой потолка или составным элементом легкой стены. Здесь нельзя однозначно говорить о преобладании восточных мотивов. Решетчатые панели уже претендуют на звание итальянской классики.</div>
<div style=\"text-align: justify;\">Среди другой продукции Comas – ширмы для радиаторов, столы, библиотеки и даже лестничные перила. Кажется, что мастера Comas настолько влюблены в свое дело, что просто не могут выбрать одно направление. Любая работа с деревом доставляет им истинное удовольствие и позволяет создавать с одной стороны простые, а с другой – необычайно притягательные предметы интерьера.</div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Comas.</div>','website'=>'http://www.comasitaly.com/','brandID'=>'38','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-07_comas']);
