        $this->insert('{{%manufacturer}}',['id'=>'7','title'=>'Cocif','alias'=>'Cocif','imageID'=>'5634','body'=>'<p>Компания Cocif со всей уверенностью заявляет о себе, как о лидере на рынке деревянных дверей. Чтобы выделиться на столь насыщенном рынке, мало просто производить двери — необходимо суметь доказать свою исключительность. И Cocif удалось это сделать!</p>
<div>Небольшая столярная мастерская, открытая в послевоенном 1945 году, стала сегодня крупнейшим предприятием с широкой дилерской сетью по всему миру. Ради этого Cocif не жалели ни сил, ни ресурсов. Вкладывая немалые средства в развитие технологий, компания сумела добиться признания покупателей и уважения коллег. Инновации, высокое качество и стиль — на этих трёх китах и основан успех предприятия.</div>
<div>Основу каталога Cocif составляют межкомнатные двери, двери для гостиниц и медицинских учреждений. Компания привлекает к сотрудничеству ведущих дизайнеров, а возможности ультрасовременных производственных мощностей Cocif позволяют воплотить любые их идеи. Соединение классической изысканности с современными видами отделки, смелые решения и не менее смелые способы их воплощения в исполнении Cocif никак не противоречат с функциональностью дверей, простотой их монтажа и удобством эксплуатации. Лишь несомненный лидер способен производить двери, столь же красивые, сколь и практичные!</div>
<div>Штаб-квартира Cocif находится в небольшом итальянском городке Лонджано, а её продукция украшает крупнейшие отельные комплексы и жилые дома по всему миру. Cocif находится в постоянном поиске новых возможностей, новых стилей, новых технологий. А это значит, что новые коллекции будут восхищать и радовать покупателей, новые модели дверей будут надёжно служить и украшать наши дома!</div>
<div> </div>
<h4>GAE AULENTI</h4>
<div>Сотрудничество со знаменитыми дизайнерами и архитекторами позволяет Cocif предлагать своим поклонникам поистине удивительные коллекции. Как, например, эта, в разработке которой принимал участие Gae Aulenti. Гармония пропорций и простых геометрических линий, скрупулёзность в выборе цвета и внимание к мельчайшим деталям характеризуют модели межкомнатных дверей этой коллекции. 6 моделей — 6 произведений искусства!</div>
<div> </div>
<h4>MITI</h4>
<div>Miti — это двери для классических интерьеров! Многослойный массив деревянных дверных рам окрашен или покрыт шпоном благородных пород. Полнотелое или ячеистое дверное полотно, украшенное рельефными панелями. Большой выбор вариантов дверей с различными видами остекления. Выбирая двери их коллекции Miti, покупатели с замиранием сердца представляют, каким же станет скоро их дом!</div>
<div> </div>
<h4>BASIC</h4>
<div>Самая демократичная, и, пожалуй, одна из наиболее популярных коллекций от Cocif! Межкомнатные двери, покрытые шпоном драгоценных пород самого высокого качества, полностью передают ощущение живого дерева. Двери, способные удовлетворить любые требования потребителя, воплотили в себе престижность бренда и неизменно высокое качество продукции.</div>
<div> </div>
<h4>CONTRACT</h4>
<div>Коллекция дверей для отелей, с повышенной звуконепроницаемостью. Для удобства отельного обслуживания установленные в дверях замки позволяют использовать общий ключ. Двери имеют международные сертификаты соответствия правилам пожарной безопасности REI30 и REI60.</div>
<div>Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Cocif.</div>','website'=>'http://www.cocif.com/','brandID'=>'39','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-05_cocif']);
        $this->insert('{{%manufacturer}}',['id'=>'8','title'=>'Dierre','alias'=>'Dierre','imageID'=>'5610','body'=>'<p>Продукция компании — межкомнатные, входные, бронированные и противопожарные двери, гаражные ворота — известна во всём мире. Широко известны и замки для входных и межкомнатных дверей, выпускаемые под этим брендом. В слогане Dierre «Твой дом, твоя жизнь» ясно слышны отголоски поговорки «Мой дом — моя крепость»: стремление сделать жизнь людей безопасной вполне можно назвать миссией компании.</p>
<div>Первая бронированная дверь Dierre была выпущена в 1978 году. С тех пор компания значительно расширила производство, ассортимент Dierre пополнился защитными и противопожарными дверьми, сейфами и гаражными воротами, межкомнатными дверьми. Компания всегда много инвестировала в развитие технологий и производства, что обусловило и широту каталога Dierre, и высокое качество всей продукции фирмы.</div>
<div>Фирме принадлежит сеть розничных магазинов Dierre Partner, где качеству обслуживания и профессионализму продавцов уделяется такое же внимание, как и качество разработок и производства. Успешно функционирует также и сеть Dierre Key Point, распространяющая профессиональные скобяные товары и метизы, а всю необходимую помощь и консультации можно получить в службе технической поддержки Dierre Technical Service.</div>
<div>Ассортимент межкомнатных дверей Dierre невероятно широк, даже небольшое описание каждой модели превратит статью в обширный трактат о дверях. Рассмотрим кратко продукцию фирмы, придерживаясь предложенной на сайте компании классификации по материалу изготовления дверей.</div>
<div> </div>
<h4>Mood Wood Basic</h4>
<div>Это универсальный ряд моделей межкомнатных дверей, которые подойдут и для офисных, и для жилых помещений. Basic представляет собой гармоничное сочетание самых современных технологий и строгого минимализма в дизайне. Коллекцию составляют 7 моделей межкомнатных дверей, каждая из которых, в свою очередь, предлагается в различных вариантах отделки и конструкции: одно-, двухстворчатая и раздвижная.</div>
<div> </div>
<h4>Mood Wood — двери из цельного дерева</h4>
<div>Что может быть естественнее изделий из цельного натурального дерева! Эти межкомнатные двери солидны и эстетичны, одним своим видом они говорят о спокойной уверенности в себе. Чтобы выделиться из толпы и приобрести индивидуальность, вовсе не обязательно гнаться за модой. Вернее будет остановиться и обернуться к классике.</div>
<div>Mood Wood из цельного дерева — это десять моделей с разнообразными видами отделки, каждая из которых индивидуальна.</div>
<div> </div>
<h4>Mood Wood — лакированные двери</h4>
<div>Эта коллекция призвана отразить самые новые тенденции в дизайне интерьера. Составляющие её 7 моделей вобрали в себя всё лучшее, что есть в современном интерьерном дизайне, умноженное на креативность и технологичность Dierre. Поиск интересных форм и интерес к использованию новых материалов отразил давнее кредо компании, заботу о безопасности потребителей. В оформлении дверей использовались исключительно безвредные и экологичные краски и лаки.</div>
<div> </div>
<h4>Mood Wood — двери с алюминиевой рамкой</h4>
<div>Живое дерево и современные материалы, сочетание «холодного» алюминия с тёплым рисунком деревянной текстуры, эклектика, которая не выглядит противоречием, а дышит гармонией. Как и во всём, что делает Dierre, в этой коллекции классика дружит с трендами, даря покупателям радость обновления интерьера!</div>
<div>Рассказ о Dierre был бы неполным без упоминания ещё одного практического воплощения неустанной заботы компании о безопасности. Безопасность для Dierre — понятие широкое, включающее в себя и заботу о сохранении окружающей среды. В 2009 году Dierre стала партнёром агентства CasaClima, которое занимается энергетической и экологической паспортизацией. Целью этого партнёрства Dierre определяет «развитие экологического сознания в обществе».</div>
<div>Компания "Абсолют Интерьер" рада предложить широкий выбор дверей  Dierre.</div>','website'=>'http://www.dierre.it/','brandID'=>'21','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-09_dierre']);
        $this->insert('{{%manufacturer}}',['id'=>'9','title'=>'Ghizzi&Benatti','alias'=>'Ghizzi-Benatti','imageID'=>'5636','body'=>'<p style=\"text-align: justify;\">Со дня своего основания в 1987 году фабрика Ghizzi&Benatti производит межкомнатные двери. Кто-то скажет: «Ещё одна итальянская дверная фирма!», и будет не прав. Среди действительно немалого числа производителей дверей в Италии не найти двух одинаковых, каждая компания имеет своё лицо и свой стиль. И в особой мере это относится к Ghizzi&Benatti!</p>
<div style=\"text-align: justify;\">Особое внимание дизайнеры уделяют деталям, которые, как известно, и создают стиль. Каждая модель межкомнатных дверей эксклюзивна и индивидуальна. Эти двери имеют своё настроение и свой характер, они не просто вписываются в интерьер, а создают его.</div>
<div style=\"text-align: justify;\">Базовыми понятиями дизайна Ghizzi&Benatti называют творчество и культуру. В самом начале разработки новой идеи её основной целью определяют выражение культуры современности посредством дизайнерских решений. Бренд быстро стал означать в сознании потребителей современный эксклюзивный дизайн и высокое качество. Компания производит действительно эксклюзивные двери: отделанные натуральным шпоном, с любовно закруглёнными твёрдыми гранями и лакировкой, которая выглядит, как атлас, талантливо придуманные и безупречно изготовленные.</div>
<div style=\"text-align: justify;\">Продукцию фабрики модно увидеть на известных отраслевых выставках: MadeExpo Milano, Macef Milano, Cosmoprof Bologna и других. Посетители этих форумов производителей имеют возможность насладиться коллекциями межкомнатных дверей Ghizzi&Benatti, выбрать и заказать понравившиеся модели. Предоставим такую возможность и вам:</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">REFLEX</h4>
<div style=\"text-align: justify;\">Межкомнатные двери из глянцевого стекла, одного из самых модных сегодня материалов. Дверная рама изготовлена из массива дерева, особая конструкция позволяет установить ручку любого типа. Модель может быть изготовлена в виде распашной либо раздвижной конструкции, в одном из 14 стандартных размеров, или под заказ — высотой до 2700 мм.</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">COLORE</h4>
<div style=\"text-align: justify;\">Обширная коллекция дверей самого разнообразного дизайна и цвета. Белый ясень и красное дерево, вишня и дуб венге, итальянский орех и отбеленный дуб, — вряд ли найдётся вариант цветовой отделки, не вошедший в Colore!</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">STREAM</h4>
<div style=\"text-align: justify;\">Эта коллекция — настоящий Stream, поток дизайнерских находок в стиле утончённого минимализма. Серия предлагает 9 различных комбинаций видов отделки и вставок, плюс огромное количество конструктивных вариантов. Коллекция включает в себя распашные, раздвижные и уходящие в стену двери.</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">STONE</h4>
<div style=\"text-align: justify;\">В этой коллекции основное внимание уделено дизайну: утончённые линии, особое внимание к деталям отделки. И, конечно, только натуральное дерево!</div>
<div style=\"text-align: justify;\"> </div>
<h4 style=\"text-align: justify;\">ENERGY</h4>
<div style=\"text-align: justify;\">Великолепная коллекция дверей, отделанных шпоном оливкового дерева, с диапазоном цветов от натуральной оливы до графита. Некоторые модели содержат декоративные вставки матового стекла в зеркальной рамке.</div>','website'=>'http://www.ghizziebenatti.it/','brandID'=>'20','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-11_ghizzi-benatti']);
        $this->insert('{{%manufacturer}}',['id'=>'10','title'=>'FOA','alias'=>'FOA','imageID'=>'5614','body'=>'<p style=\"text-align: justify;\">1974 год так и остался бы ничем не примечательной датой в истории дизайна и производства межкомнатных дверей, не будь в этом году основана компания FOA porte на базе завода художественной игрушки, и давшему новой фирме свою аббревиатуру (Fabbrica Oggetti Artistici) в качестве имени.</p>
<div style=\"text-align: justify;\">Слоган компании — «Двери для жизни» — как нельзя лучше отражает подход FOA к разработке и производству своей продукции, пользующейся спросом далеко за пределами Италии. Этот короткий девиз выражает и концептуальную философию FOA, и её прикладное применение в деятельности. Эти двери действительно привносят в дом частичку радости жизни!</div>
<div style=\"text-align: justify;\"> </div>
<h3>Стекло, алюминий и дерево</h3>
<div style=\"text-align: justify;\">Стекольный цех в FOA считают сердцем компании. Здесь умелые руки мастеров воплощают в жизнь оригинальные идеи дизайнеров, превращая стекло в волшебные витражи и отделку. Не менее серьёзно в компании относятся и к дереву, ведь от качества сырья и точности его обработки зависит качество конечного продукта. Тщательно выбирая дерево лучших сортов, краснодеревщики компании создают настоящие шедевры дверного искусства! Широко используются и алюминиевые конструкции. Дизайнеры FOA porte любят этот лёгкий и прочный материал!</div>
<div style=\"text-align: justify;\">Россияне получили отличную возможность познакомиться с продукцией FOA весной 2009 года, когда компания представила свою экспозицию на московской выставке «MosBuild Doors&Locks 2009». Естественно, появление производителя такого масштаба не могло остаться незамеченным для российских бизнесменов, в результате чего продукция компании стала доступной и в России.</div>
<div style=\"text-align: justify;\">FOA porte предлагает несколько коллекций межкомнатных дверей, каждая из которых вызывает восхищение и уважение к кропотливой работе дизайнеров, проектировщиков и мастеров компании.</div>
<div style=\"text-align: justify;\"> </div>
<h4>TEKNO</h4>
<div style=\"text-align: justify;\">Сочетание стали и стекла вдохновило дизайнеров компании на создание этой коллекции. Одно- и двух панельные раздвижные двери, представленные в каталоге Tekno, отличаются минимализмом, чёткостью линий и высокой точностью исполнения. Уникальная техника декорирования "Vetro Liquido" позволила создать ультрасовременные межкомнатные двери с яркой отделкой.</div>
<div style=\"text-align: justify;\"> </div>
<h4>ELEGANCE</h4>
<div style=\"text-align: justify;\">В эту коллекцию вошли 73 модели дверей, отделанных 244 видами стекла. Среди практически бесконечного выбора всевозможных комбинаций каждый найдёт именно те двери, которые ему хотелось бы видеть у себя дома! Элегантная классика тесно переплетается с современными дизайнерскими находками, придавая индивидуальность каждой из моделей. В коллекции представлены различные конструкции межкомнатных дверей: раздвижные и уходящие в стену, складные двери-концертино, распашные двери с одной и двумя створками.</div>
<div style=\"text-align: justify;\"> </div>
<h4>SLIM</h4>
<div style=\"text-align: justify;\">Двери выполнены из разных пород дерева или же из алюминия, однако главный герой этой коллекции — стекло. Строгие линии дверных рам, внутри которых разыгрывается неудержимая</div>
<div style=\"text-align: justify;\">игра света. Минимализм исполнения — максимум вдохновения!</div>
<div style=\"text-align: justify;\"> </div>
<h4>SINTHESY</h4>
<div style=\"text-align: justify;\">Созданию этой коллекции предшествовали глубокий анализ актуальных трендов и основательное изучение современных стилей дизайна. Алюминий, многослойное стекло, геометрические аппликации придают этим дверям фантастический вид! Представленные в коллекции модели Quadra, Sliver, Stylo и Light очаруют поклонников модных течений в дизайне интерьера.</div>
<div style=\"text-align: justify;\"> </div>
<h4>FLAT</h4>
<div style=\"text-align: justify;\">Раздвижные перегородки и распашные межкомнатные двери этой коллекции выполнены из тонкого профиля с квадратным сечением. Они функциональны и красивы, отделка стеклянных поверхностей идеальна, а узоры — завораживают. Flat можно было бы назвать лучшими межкомнатными дверями, не существуй у FOA других коллекций!</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Каталог FOA porte наводит на мысль, что не существует пределов в нахождении всё новых и новых способов обработки стекла, составления узоров на стеклянных поверхностях, мозаик и витражей. Каждая коллекция компании раскрывает новые направления дизайна интерьера, вдохновляя и радуя. FOA porte — настоящие «двери для жизни»!</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей FOA.</div>','website'=>'http://www.foaporte.it/','brandID'=>'6','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-10_foa']);
