        $this->insert('{{%manufacturer}}',['id'=>'12','title'=>'Henry Glass','alias'=>'Henry-Glass','imageID'=>'5632','body'=>'<p style=\"text-align: justify;\">Фабрика Henry Glass основана в 1988 году, однако мировую популярность работы итальянских мастеров получили после 2005, когда предприятие было полностью переоборудовано. Сейчас завод занимает 20000 квадратных метров и использует передовые технологии в области резки и колеровки стекла, обработке кромки и декоративном оформлении.</p>
<div style=\"text-align: justify;\">Несмотря на активное применение современных технологий, в производстве широко используется ручной труд декораторов, работающих с венецианским (муранским) стеклом. Это позволяет Henry Glass относить себя не просто к производителю дверей, а к законодателям интерьерного дизайна.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">В производстве используются прозрачные, цветные и покрыты лаком стеклянные пластины более чем двух десятков расцветок. Но цвет самого полотна – не единственное, что позволяет художникам Henry Glass создавать уникальные по технике и орнаменту стеклянные двери. Вставки из венецианского стекла придают полотну живость, наделяют его характером и привносят легкость. Спокойные абстрактные узоры, позволяющие сохранить строгость и элегантность, создаются методом пескоструйной шлифовки. Зеркальный лак создает эффект глубины, расширяя пространство игрой отражения и света.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Традиционно для производителей дверей, Henry Glass предлагает несколько типов открывания полотна. Запатентованный механизм распашных дверей позволяет распахивать их на 180 градусов. Сдвигающиеся в стену отличаются простотой установки конструкции. Сдвижные внешние двери представлены как просто сдвижным полотном на открытой конструкции, так и в составе стеклянной стены, направляющие которой могут крепиться в проеме или прямо к пололку. Наконец, фабрика предлагает двери, распахивающие в обе стороны. Механизм крепежной конструкции практически незаметен, поэтому со стороны создается ощущение, что дверное полотно удерживают невидимые силы.</div>
<div style=\"text-align: justify;\"> </div>
<h3>Коллекции</h3>
<div style=\"text-align: justify;\">Хотя все многообразие вариантов цветовой гаммы, ручной работы и технологичных решений, не терпит строгого деления по коллекциям, Henry Glass выделяет свои шедевры в четыре серии.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Vitra</h4>
<div style=\"text-align: justify;\">Коллекция дверей Vitra возвышает чистоту стекла полным отсутствием какого бы то ни было обрамления самого полотна и идеальной полировкой края по периметру. Здесь нет лишних элементов: только стекло, практически незаметная фурнитура и лаконичная металлическая рама.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Sinea</h4>
<div style=\"text-align: justify;\">Легкость ровного стеклянного полотна изящно оттеняется тонкими полосками алюминия.  Контраст между стеклом и металлом создает двойной эффект цвета и текстуры, сочетая воздушность с прочностью, а доступность с надежностю.</div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Henry Glass.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Tekna</h4>
<div style=\"text-align: justify;\">Эта коллекция отдает дань минималистичному направлению дизайна интерьеров. Ничего лишнего, ничего слишком привлекающего внимания. Эргономичные ручки, тонкие профили в различной отделке и простое листовое стекло – вот секрет изящества дверей серии Tekna.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Domea</h4>
<div style=\"text-align: justify;\">В этой серии дизайнеры Henry Glass позволили металлу и дереву стать полноправными участниками живописного полотна, а не оттеняющим дополнением, как в других коллекциях. Широкие линии металла придают монументальности, а отделка шпоном создает ощущение уюта и привносит нотку классики в оформление пространства.</div>
<div style=\"text-align: justify;\"> </div>
<h3>Художники фабрики</h3>
<div style=\"text-align: justify;\">Для фабрики Henry Glass настоящие произведения искусства воплощают в стекле семь выдающихся художников Италии. Работы Ugo Nespolo несут идею оживления изначально строго функционального и безликого дизайна. Alessandro Mendini виртуозно расписывает двери линиями, идущими строго параллельно и изгибающимися только под прямыми углами. Riccardo Dalisi, Afra e Tobia Scarpa и Emilio Tadini используют дверное полотно, как идеальный фон для своих витражных картин. Renata Bonfanti работает со всем полотном, покрывая его причудливым текстурным орнаментом. Bruno Munari точно чувствует грань между лаконичным дизайном и изящным искусством.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">В этом главный секрет Henry Glass – объединить индивидуальность авторов с передовыми технологиями и непревзойденным качеством конструкций и фурнитуры.</div>','website'=>'http://www.henryglass.it/','brandID'=>'7','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-12_henry-glass']);
        $this->insert('{{%manufacturer}}',['id'=>'13','title'=>'Impronta','alias'=>'Impronta','imageID'=>'5635','body'=>'<p style=\"text-align: justify;\">Итальянская фабрика Impronta, основанная в итальянском городе Тревизо в результате слияния нескольких малых производств, специализируется на создании входных и межкомнатных дверей, окон и ставень, решений для гостиниц и ресторанов. Само предприятие появилась сравнительно недавно – около 20 лет назад, однако компании, объединившиеся под именем Impronta, могут похвастаться полувековой историей.</p>
<div style=\"text-align: justify;\">За годы существования фабрики ее продукция неоднократно совершенствовалась и улучшалась. Речь идет не столько о развитии технологий, сколько о внешнем исполнении. Произведения Impronta соответствуют духу времени и отвечают актуальным стилистическим требованиям. Впрочем, дизайнеры фабрики не забывают и о традициях, но это заслуживает отдельного разговора.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Чтобы оставаться законодателями современной интерьерной моды, на базе Impronta было создано проектное бюро. Весь цикл производства, начиная с эскизов и подборки материалов, заканчивая тестированием и поступлением готовых изделий в продажу, осуществляется силами фабрики. Автоматизация всех этапов позволяет добиться высочайшего качества при интенсивной разработке новых решений. Каждая модель каждой серии – плод совместного труда дизайнеров, технологов, инженеров и других специалистов Impronta. Осуществляя полный цикл производства, фабрика Impronta подчеркивает свою индивидуальность и самодостаточность.</div>
<div style=\"text-align: justify;\"> </div>
<h3><span style=\"text-align: start;\">Межкомнатные двери</span></h3>
<div style=\"text-align: justify;\">Межкомнатные двери представлены четырьмя коллекциями. Основной ассортимент распределен по коллекциям Modern и Design, а небольшие серии Classic и NextDoor емко отражают два абсолютно разных направления дизайна. Которые, однако, успешно сосуществуют в рамках ассортимента продукции Impronta.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Modern</h4>
<div style=\"text-align: justify;\">Современные межкомнатные двери, какими мы привыкли их видеть. Гармоничное сочетание дерева и стекла, реже – цельные полотна с рельефной отделкой. Лаконичные, стильные, подчеркнуто деловые. Строгие прямые линии и спокойное сочетание цветов позволяет этим дверям претендовать на звание классики 21 века. Модели коллекции Modern – это дополнение к дизайнерскому решению интерьера, но не его доминанта.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Design</h4>
<div style=\"text-align: justify;\">В серии Design в полной мере воплощается умение дизайнеров фабрики одним-двумя штрихами превратить казалось бы обычное дверное полотно в яркий элемент современного интерьера. Так, например, в модели Over 18 L это достигается за счет тонкой линии стекла, а в Over 100 – фактурным геометрическим орнаментом. </div>
<div style=\"text-align: justify;\">Приковывающие внимание сами по себе, двери коллекции Design требуют смелости от проектировщика интерьера. У него не получится обойтись стандартными решениями и придется искать, как отразить идеи дверей Impronta в общем оформлении пространства. Впрочем, результат стоит этих трудов.</div>
<div style=\"text-align: justify;\"> </div>
<h4>Classic</h4>
<div style=\"text-align: justify;\">Особая коллекция, в которой фабрике удалось сохранить простоту и домашний уют классических итальянских интерьеров. Натуральное дерево, простые формы и отсутствие даже полунамека на современный дизайн – вот на чем базируются модели этой серии. Главные герои коллекции – Rustica B и Rustica M. Воплощение итальянской этноклассики и идеальное раскрытие красоты простого дерева, не спрятанного за тяжелой фурнитурой, строгими линиями и излишним декором.</div>
<div style=\"text-align: justify;\"> </div>
<h4>NextDoor</h4>
<div style=\"text-align: justify;\">Удивительно, насколько точно дизайнерам удалось отразить тенденции современного дизайна, балансирующего на грани минимализма. Работая над коллекцией, они четко выдержали баланс между предельной простотой и изысканностью. Однотонное сплошное полотно, дополненное лаконичной фурнитурой, в буквальном смысле выдвигается на первый план. Широкий косяк по двум сторонам создает актуальную асимметрию, а боковая подсветка берет на себя задачу тех самых штрихов, которые превращают функциональность в дизайн.</div>
<div style=\"text-align: justify;\"> </div>
<h3>Входные двери</h3>
<div style=\"text-align: justify;\">Входные двери Impronta представлены не так широко, но столь же стилистически разнообразно. Этническая Asolo хранит традиции маленьких итальянских городков и деревень. Трехпанельная Classica воплощает идею функциональной простоты и классического оформления. Стильные, аккуратные и лаконичные Philos выполнены в лучших традициях европейского минимализма. </div>
<div style=\"text-align: justify;\"> </div>
<h3>Другая продукция</h3>
<div style=\"text-align: justify;\">Не ограничиваясь только дверьми, Impronta создает окна и ставни, разрабатывает интерьеры для гостиниц и выполняет комплексные дизайн-проекты. И везде предлагает три стилевых направления – этноклассика, современная классика и уникальные дизайнерские решения.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Impronta.</div>
<p> </p>','website'=>'http://www.impronta.info/','brandID'=>'8','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-13_impronta']);
        $this->insert('{{%manufacturer}}',['id'=>'14','title'=>'Longhi','alias'=>'Longhi','imageID'=>'5617','body'=>'<p>Ассортимент итальянской фабрики Longhi не ограничивается дверьми. Компания предлагает коллекцию мебели для жилых и офисных помещений: диваны и кресла, столы, столики и стулья, шкафы и стеллажи, а также аксессуары: ковры, лампы, зеркала пледы и подушки. Но своей мировой популярность Longhi обязана все-таки межкомнатным перегородкам и дверям.</p>
<div>Говоря о своей продукции, Longhi подчеркивает, что все изделия соответствуют требованиям к современному образу жизни. В своих работах дизайнеры и проектировщики отталкиваются от функциональности и практичности. Что, впрочем, не мешает им создавать двери и мебель, наполненные индивидуальностью. Продукция Longhi – это и не хай-тек, и не попытки воссоздать ретро-интерьеры. Это естественно развитие стиля. Сочетание классических идей с современными требованиями к конструкции и облику.</div>
<div> </div>
<div>Тот факт, что фабрика производит не только двери, говорит о глубоком понимании, как должны сочетаться элементы интерьера. Все предметы создаются не в отрыве от реальности, а в контексте современных дизайнерских решений. Даже если вы не планируете обставлять комнату мебелью исключительно этого производителя, то заметите, с какой легкостью двери Longhi вписываются в общую картину.</div>
<div> </div>
<div>Фабрика предлагает десять коллекций, в каждой их которых представлены раздвижные перегородки разных конструкций и традиционные распашные двери.</div>
<div> </div>
<h4>IANUS</h4>
<div>Эту серию Longhi посвятила римскому богу дверей и проходов Янусу. Подобно этому божеству, двери коллекции IANUS сочетают два лица, две черты характера. Предельно простые и лаконичные формы поверхностей настраивают на минимализм, в то время как рисунок стекла и масштабность конструкций стеновых панелей находятся на грани роскоши и шика.</div>
<div> </div>
<h4>CRISTALL</h4>
<div>Кристально чистые решения, тонкие линии наличников и простые формы фурнитуры – вот основные отличия этой серии, очень точно отмеченные названием коллекции.</div>
<div> </div>
<h4>HEADLINE</h4>
<div>Название этой серии переводится как «заглавие». HEADLINE – это противопоставление современной тенденции создания «незаметных» перегородок. Однако заметность сочетается со сдержанностью, поэтому двери не доминируют в интерьере, а как бы озаглавливают его.</div>
<div> </div>
<h4>WIND</h4>
<div>Еще один образец легких решений. Но, в отличие от минималистичной коллекции CRISTALL, двери WIND обладают характером, хотя и не выставленным напоказ.</div>
<div> </div>
<h4>SPARK</h4>
<div>Если пытаться перевести это название, то более точным будет слово «проблеск». На этой коллекции хорошо видно, как Longhi последовательно развивает свои идеи. От минималистичных CRISRALL через наполненных характером WIND к проблеску индивидуальности. Без потери легкости и простоты форм.</div>
<div> </div>
<h4>STREET</h4>
<div>Пусть вас не вводит в заблуждение название этой коллекции. Двери STREET – межкомнатные, а не уличные. В распахнутом виде они становятся практически незаметными, нивелируя ощущение разделенного дверным проемом пространства.</div>
<div> </div>
<h4>WOOD STRIPED</h4>
<div>Называя эту серию, компания Longhi решила обойтись без метафор и просто объединила материал и форму. Отделка широкими деревянными полосами – беспроигрышный вариант для практически любых помещений. Впрочем, модели этой коллекции получились чересчур строгими для дома. Зато идеально подходящими для офисных помещений.</div>
<div> </div>
<h4>SHADOW</h4>
<div>Восточные решетчатые мотивы в дизайне дверей давно стали негласным стандартом отрасли. Но и здесь Longhi удалось проявить индивидуальность, избавившись от этнического оттенка, но сохранив уют ритмичных горизонтальных полос.</div>
<div> </div>
<h4>WALL-UP</h4>
<div>Настоящий шедевр и отличная демонстрация глубоких познаний не только в интерьерном дизайне, но и в архитектуре. Полотно представляет собой массивную ровную поверхность без каких бы то ни было декоративных элементов и фурнитуры. Высотой до потолка дверь выглядит словно часть стены, чуть выдвинутая вперед. Еще более интересный эффект достигается, когда межу верхней частью дверного проема и потолком остается пространство.</div>
<div> </div>
<h4>LORD SYSTEM</h4>
<div>Longhi  удается сочетать несочетаемые, на первый взгляд, вещи. В коллекции LORD монументальность и насыщенностью гармонично сосуществуют с простотой. Видимо, весь секрет в благородной отделке и удлиненной форме.</div>
<div>Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Longhi.</div>','website'=>'http://www.longhi.it/','brandID'=>'11','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-16_longhi']);
        $this->insert('{{%manufacturer}}',['id'=>'15','title'=>'Lualdi','alias'=>'Lualdi','imageID'=>'5637','body'=>'<p>Глядя на продукцию итальянской фабрики Lualdi, кажется, что это молодая команда чрезвычайно талантливых дизайнеров, находящихся в постоянном поиске. Однако за этой кажущейся молодостью стоит более чем вековой опыт производства мебели. Творческий путь фабрики начался в конце 19 века. Причем, производство дверей стало основным направлением лишь с середины 20 века.</p>
<div> </div>
<div>Основы подхода Lualdi Porte к дизайну заложил один из самых эксцентричных итальянских архитекторов Луиджи Доминеоне. Его идеи до сих пор используются в некоторых коллекциях, а дизайнеры Lualdi хранят верность нестандартному и смелому подходу, принесшему компании мировую известность.</div>
<div> </div>
<div>Смелость Lualdi не только в форме, но и в материале. Лакированный полиэстер, кожа, шпон алюминий гармонично сочетаются в динамичных работах моделях фабрики. Особое внимание уделяется технологическим решениям. Незаметные конструкции, скрытые рамы, лаконичная фурнитура, широкий выбор цветовой гаммы и возможность окрасить или оформить дверное полотно обоями открывают огромный простор для фантазии.</div>
<div> </div>
<div>Основная коллекция насчитывает 17 моделей, объединенных идеей технологичности и универсальности.</div>
<div> </div>
<div>– OUTLINE – воплощение минимализма, подчеркнутого названием, которое переводится как «набросок». Чистый объем и трехмерность создают произведение архитектуры, способное придать любому пространству определенность и завершенность.</div>
<div> </div>
<div>– Сдвижные двери DRIVE выглядят как стеновые панели или элемент декора, скрывая свое основное функциональное назначение. Алюминиевые направляющие естественного  или черного цвета крепятся над дверным проемом и скрываются полотном. Невидимый крепеж создает эффект необычайной легкости.</div>
<div> </div>
<div>– Модель SHOIN создана дизайнерами, вдохновленными светом и мобильностью поверхностей традиционного японского дома. Система состоит из одного или двух стеклянных полотен в тончайшей алюминиевой раме и межкомнатных перегородок.</div>
<div> </div>
<div>– Шарнирное крепление, большая толщина и невидимый алюминиевый косяк создают ощущение, что дверь RASOMURO 55N – это часть стены, а не отдельный элемент пространства.</div>
<div> </div>
<div>– RASOMURO 41 отличаются тонкой алюминиевой коробкой, которая, в отличие от предыдущей модели, ненавязчиво обозначает дверной проем, но тоже не акцентирует на нем излишнего внимания.</div>
<div> </div>
<div>– COMPASS 55 с самозакрывающимся механизмом, скрытой коробкой и нестандартным креплением полотна можно сравнить с плотным занавесом. Эти двери и разделяют пространство, и дают ощущение легкости, с которой можно перемещаться из помещения в помещение.</div>
<div> </div>
<div>– WALL & DOOR – система из дверей и стеновых панелей, созданная для простых рациональных решений. Идеально для офисных помещений.</div>
<div> </div>
<div>– Двусторонние FILO 55 с широкими косяками и идеально чистой и ровной поверхностью отлично подходят для покраски и отделки. Простые формы позволяют использовать эти двери в любых современных интерьерах.</div>
<div> </div>
<div>– Двери BLUES – еще один пример, как Lualdi удается минимальными средствами добиться  выразительного эффекта. Отличительные особенности этой модели – алюминиевый косяк средней ширины и тонкое обрамление стеклянных полотен. </div>
<div> </div>
<div>– Строгость дверей ALA создана тонкими горизонтальными линиями из нержавеющей стали. Тень, отбрасываемая наличниками особой формы, убирает контраст между дверным проемом и стеной, приумножая объем и трехмерность.</div>
<div> </div>
<div>– Простые формы модели LCD62 сочетаются с реверсивными скрытыми петлями и косяком, адаптируемым к различной толщине стен. На этом простом примере Lualdi доказывает, что технологичность зачастую важнее формы и декора.</div>
<div> </div>
<div>– Двери SAN SIRO – смелая интерпретация классических форм, заключающаяся в игре с пропорциями и чуть диссонирующим оформлением дверного полотна.</div>
<div> </div>
<div>– ESSE и ESSE03 – еще одно нестандартное решение. Изогнутое полотно напоминает о мягкости натуральных форм и гармоничном движении волны.</div>
<div> </div>
<div>– SUPER – современное видение исторической модели, созданной Луиджи Доминеоне. Ее особенности – тонкая рама с округлыми формами, чуть выступающее полотно со скругленными торцами и скрытые реверсивные петли.</div>
<div> </div>
<div>– Двери TRIS и LCD87, как развитие идей, заложенных в предыдущей модели, отличаются еще более выраженными округлостями торцов и дверного полотна.</div>
<div>American collection - особые коллекции Lualdi, созданные тремя американскими архитекторами. В результате сотрудничества на свет появилось три серии, каждая из которых сочетает индивидуальность авторов из США с лучшими традициями итальянской фабрики.</div>
<div> </div>
<div>– В серии DAVINA дизайнер Дрор Беншетрит очень точно уловил идею технологичного минимализма. Простая диагональ создает ощущение двуцветной глубины, которая раскрывается внутри дверной коробки и создает иллюзию того, что дверь слегка приоткрыта.</div>
<div> </div>
<div>– UPTOWN, MIDTOWN и  DOWNTOWN – три модели, созданные Дэвидом Роквеллом из благородных материалов. Отделка древесиной ценных пород, два бронзовых горизонтальных штриха и ручка из натуральной кожи, проходящая по всей длине двери, великолепно отражают идею американского размаха и богатства, органично выставленного на всеобщее обозрение.</div>
<div> </div>
<div>– В моделях AVENUE Роберт Стерн продемонстрировал, что такое американский взгляд на итальянскую утонченность. Симметричные и сбалансированные, они дополняют современные интерьеры бессмертными классическими формами.</div>
<div> </div>
<div>Кроме межкомнатных дверей, Lualdi предлагает комплексные интерьерные решения для оформления офисов, выставочных залов и гостиничных номеров.</div>
<div> </div>
