        $this->insert('{{%manufacturer}}',['id'=>'16','title'=>'New Design Porte','alias'=>'New-Design-Porte','imageID'=>'5761','body'=>'<p style=\"text-align: justify;\">Компания  New Design Porte квартирует в Монтериджони, в Тоскане. В 1996 году группа энтузиастов, имевших за плечами немалый опыт работы в столярном производстве, решила объединиться для создания собственного предприятия. Знания и навыки, накопленные за предшествующие годы, вместе с возможностью осуществления собственных идей и взглядов на производство межкомнатных дверей стали удачным для молодой компании сочетанием. New Design Porte быстро стала известна как производитель по-настоящему стильных дверей для потребителей, стремящихся оформить свой дом со вкусом.</p>
<div style=\"text-align: justify;\">Ориентируясь в разработке моделей дверей на стили самых разных эпох, New Design Porte удачно совмещают современные технологии обработки дерева с ручной работой мастера-декоратора. В отделке нередко используются материалы, применявшиеся сотни лет назад: патина, пчелиный воск гуммилак. Таким образом, возникает уникальная ситуация. Продукция фирмы не имитирует двери XVII или XVIII веков, не является подделкой под старину. Это — настоящие классические деревянные двери, произведенные в XXI веке из материалов и по технологиям, применявшихся в века прошлые. Отличить двери New Design Porte от старинных дверей под силу лишь специалисту, настолько точно они передают все тонкости работы древних мастеров!</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Классика — не единственная страсть дизайнеров New Design Porte. Талантливые разработчики черпают вдохновение не только в прошлом, а и в будущем, талантливые производители внедряют оборудование, созданное с применением новейших технологий.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Технологии, современное оборудование — и ручная отделка; инновационные материалы — и натуральные продукты, применявшиеся сотни лет назад; классика и современность. New Design Porte умеет работать и с новейшей обрабатывающей производственной линией, и с традиционными стамеской и резчиком. Уникальная компания, производящая уникальные двери.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Коллекции дверей New Design Porte представляют собой учебник по истории искусства, каждая из них представляет отдельную эпоху, отдельный стиль.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Коллекция <strong>LE EMOZIONI</strong>, Эмоции, представляет неоклассицизм. <strong>XIV</strong> <strong>век</strong> посвящена итальянскому готическому средневековью, а <strong>XV</strong> <strong>век</strong> — Ренессанс, эпоху, когда столярное производство регламентировалось множеством правил, эпоху, давшую миру столько прекрасных произведений искусства!</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Далее каталог компании ведёт нас от коллекции <strong>XVI</strong> <strong>век</strong>, Позднего Возрождения, к коллекции в стиле барокко <strong>XVII</strong> <strong>век</strong>. Развившийся далее новаторский стиль рококо представлен в коллекции межкомнатных дверей <strong>XVIII</strong> <strong>век</strong>, естественно перетекая в модернизм, art nouveau, с блеском отражённые коллекцией <strong>XX</strong> <strong>век</strong>.</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Для остекления дверей используются стекло с гравировкой, витражи, сатинированные стёкла со вставками из плавленого стекла. Вся фурнитура, петли, шарниры и дверные ключи разрабатываются в соответствии с выбранной стилистикой. Задвижки, щеколды, дверные колотушки и другие аксессуары выглядят, как музейные экспонаты. Каждая мелкая деталь, каждый гвоздь соответствуют эпохе коллекции. Нет никаких сомнений в том, что New Design Porte — уникальная компания, производящая уникальные межкомнатные двери!</div>
<div style=\"text-align: justify;\"> </div>
<div style=\"text-align: justify;\">Компания "Абсолют Интерьер" рада предложить широкий выбор дверей New Porte.</div>','website'=>'http://www.newdesignporte.com/','brandID'=>'3','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-18_design-porte']);
        $this->insert('{{%manufacturer}}',['id'=>'17','title'=>'Oikos','alias'=>'Oikos','imageID'=>'5624','body'=>'<p>С 1990 года Oikos производит бронированные двери на своей фабрике в Груаро (Венеция). Oikos стремится контролировать не только каждый этап, а и каждый момент производства, и все работы ведутся в рамках фабрики, которая разделена на три основные части: механическая и столярные мастерские, и цех сборки. Столь кропотливую заботу о качестве в компании считают необходимым условием успеха.</p>
<div> </div>
<div>В секторе производства бронированных дверей Oikos занимает лидирующие позиции. С самого начала работы компания принимает регулярное участие в престижной международной выставке MADE, ранее называвшейся Saie. Каждую новую модель перед запуском в производство Oikos представляет на выставке, и такой способ проверки «живучести» продукции требует немалой уверенности в своих силах. Такая уверенность у компании, разумеется, есть. Как и умение организовать все этапы разработки и производства, и многие другие качества, необходимые лидеру отрасли.</div>
<div> </div>
<div>Только в Италии розничная сеть Oikos насчитывает 300 точек продажи. Знают бронированные двери, произведенные на фабрике в Груаро, и далеко за пределами страны.</div>
<div> </div>
<div>Свою миссию Oikos видит в обеспечении безопасности жилища. Для этой цели в компании созданы линии бронированных дверей, дизайн и разнообразие отделки которых разрабатывались таким образом, чтобы двери Oikos можно было установить в домах любой архитектуры, с любой конструкцией стен, и чтобы эти двери удовлетворяли любые эстетические запросы жителей этих домов.</div>
<div> </div>
<h4>SYNUA</h4>
<div>Чистый и элегантный дизайн делает эти двери универсальными. Synua будет уместна и в многоквартирном доме типового проекта, и в частном особняке престижного архитектора.</div>
<div>Эта дверь имеет довольно большие размеры, вращается на вертикальных осевых петлях и устанавливается в одной плоскости со стеной.  Ширина двери может достигать 220 см, высота — 300. Минимально возможная ширина полотна составляет 115 см. Внешне элегантная и изысканная, такая дверь станет неприступной защитой дома благодаря использованию высокопрочной стали и запатентованной конструкции запоров. Среди вариантов отделки компания предлагает дерево, различные виды лакировки, отделку под керамику и под кожу, и другие.</div>
<div> </div>
<h4>VELA</h4>
<div>Двери для внутреннего использования в помещениях, доступ в которые требует защиты. Vela — это первая модель раздвижной бронированной двери. Высота двери соответствует высоте помещения: открытая дверь значительно расширяет пространство, закрытая — делает помещение неприступным. Возможна также установка на вертикальных осевых шарнирах как вариант распашной двери.</div>
<div>Для отделки дверей могут быть использованы все доступные Oikos материалы. Таким образом, обеспечивается возможность органичной интеграции Vela в любую стилистику интерьера.</div>
<div> </div>
<h4>iDOOR</h4>
<div>Бронированные двери для внутренних помещений, совмещающие высокую функциональность с эстетикой. Создание iDoor стало ещё одним шагом Oikos к обеспечению безопасности жилища. Благодаря этим дверям любая комната может стать абсолютно безопасной, а широкий выбор цветов и материалов отделки позволит гармонично вписать дверь в любой интерьер.</div>
<div> </div>
<h4>TEKNO</h4>
<div>Современные бронированные входные двери, для создания которых потребовался крепкий сплав высоких технологий и дизайнерских инноваций. Горизонтальные элементы двери могут иметь разнообразную отделку, в соответствии с пожеланиями заказчика.</div>
<div> </div>
<h4>EVOLUTION</h4>
<div>Бронированные двери с классическим дизайном. Предлагается широкий выбор размеров, моделей и индивидуальных вариантов изготовления. Классическая отделка благородных пород дерева скрывает под собой мощную стальную конструкцию.</div>
<div>Все двери Oikos обеспечивают высокий уровень тепло- и звукоизоляции, их отделка способна сопротивляться воздействию влаги и стойко переносит перепады температур.</div>
<div><br />
Компания "Абсолют Интерьер" рада предложить широкий выбор дверей Oikos.</div>','website'=>'http://www.oikos.it/','brandID'=>'25','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-19_oikos']);
