        $this->insert('{{%manufacturer}}',['id'=>'19','title'=>'Porte in Door','alias'=>'porte-in-door','imageID'=>'5630','body'=>'<p>Porteindoor — именно тот случай, когда слово «молодость» никак не означает «неопытность». Основанная уже в нынешнем тысячелетии, молодая фабрика быстро заняла лидирующие позиции на рынке. В таких случаях принято говорить о «секретах успеха», но здесь секрет не составляет никакой тайны и лежит на поверхности. Просто создатели межкомнатных дверей Porteindoor умеют смотреть и в прошлое, и в будущее. Из прошлого почерпнуты традиции и наработки итальянских ремесленников, а в будущем дизайнеры сумели усмотреть тенденции развития. Вот и весь секрет, который и дал нам эти прекрасные двери: сочетание традиций тосканских мастеров-краснодеревщиков и современных трендов!</p>
<div> </div>
<div>Фабрика была создана в 2004 году. Производство возникло не на пустом месте, ему предшествовали немалый опыт в проектировании и создании межкомнатных дверей и творческое сотрудничество с известным дизайнером Марко Менкаччи. Огромное внимание в компании уделяется конструктивным исследованиям и поискам новых решений в дизайне. Такая скрупулёзность и стала причиной того, что двери Porteindoor отлично сочетаются с совершенно разными интерьерами. Общественные помещения или частные дома, классический дизайн или футуристическая отделка, — эти двери везде выглядят на своём месте!</div>
<div> </div>
<div>Porteindoor радует потребителей ежегодными пополнениями коллекций. Новые краски, новые материалы, новые конструкции и новые идеи  не перестают радовать поклонников продукции этой компании! Porteindoor предлагает обширную коллекцию стандартных моделей межкомнатных дверей, но при желании производит и двери на заказ. Срок производства заказных моделей несколько дольше обычного, так как такие двери изготавливаются вне налаженного технологического цикла.</div>
<div> </div>
<div>Сегодня фабрика предлагает 13 коллекций с большим количеством моделей в каждой. Все модели разработаны Марко Менкаччи. Расскажем о наиболее популярных из коллекций Porteindoor.</div>
<div> </div>
<h4>PRISMA</h4>
<div>Необычный вид этим дверям придаёт створка, составленная из двух частей, разделённых вертикальным уголком. Части двери расположены под углом друг к другу, что выглядит нестандартно, свежо и современно. Среди 24-х вариантов отделки несложно будет выбрать тот, который подойдёт к вашему интерьеру!</div>
<div> </div>
<h4>CAVALIERI</h4>
<div>На создание этой коллекции дизайнера вдохновили лучшие произведения итальянских архитекторов. Элегантные детали, закруглённые элементы, гениальная простота: чтобы создать такие двери, мастеру оказалось достаточно лишь посмотреть вокруг… и выразить свои ощущения!</div>
<div> </div>
<h4>MANTEGNA</h4>
<div>Утончённый эстет, знаток и поклонник искусства эпохи Возрождения, выберет, без сомнения, эти модели! А более двух десятков видов отделки и качество исполнения XXI века делают дизайн «а-ля средневековье» как нельзя более актуальным и современным.</div>
<div> </div>
<h4>CANALE</h4>
<div>Оригинальность этой коллекции придаёт светлый вертикальный «канал» по центру дверного полотна, в некоторых моделях сочетающийся с круглыми «окошками».</div>
<div> </div>
<h4>NOVA</h4>
<div>Широкий закруглённый наличник из цельной древесины в этих моделях служит не просто элементом конструкции дверей, а придаёт им исключительно гармоничный вид. Дух ART NOUVEAU, гармония и простота, нашёл своё современное воплощение в этой коллекции.</div>
<div> </div>
<h4>IMPERIALE</h4>
<div>Лёгкие формы с геометрически внушительным контуром, декоративная «корона», венчающая каждую дверь, средиземноморские мотивы в орнаменте отделки. Эта коллекция стала данью уважения мастера вечно живому стилю «ампир».</div>
<div> </div>
<h4>TOSCA</h4>
<div>Tosca — это не только опера гениального Пуччини, это ещё и коллекция не менее гениальных дверей от Porteindoor в тосканском стиле! Ручная отделка состаренным орехом, горизонтальные линии делают дверь похожей на вход в старинную таверну. Эти двери прекрасно подтверждают редкое умение мастеров фабрики сочетать древние традиции и современность.</div>
<div> </div>
