        $this->insert('{{%manufacturer}}',['id'=>'23','title'=>'Itlas','alias'=>'Itlas','imageID'=>'5642','body'=>'<p style=\"text-align: justify;\">Компания Itlas — одно из самых крупных предприятий по производству паркета в Италии. Производимая данной фабрикой паркетная доска — это напольное покрытие высочайшего класса, на 100% состоящего из натурального дерева, качество и селекция которого соответствует самому высокому уровню требований. С паркетной доской ITLAS Вы сможете воплотить в жизнь самые смелые дизайнерские решения, т. к. в ассортименте фабрики представлены как европейские, так и экзотические породы деревьев с различными видами обработок: лак, масло, брашировка, волнистое строгание, битая фаска, искусственное старение, тиснение не дереве.</p>','website'=>'http://www.itlas.com/','brandID'=>'29','isPublished'=>'1','meta_title'=>'','meta_description'=>'','meta_keywords'=>'','class'=>'s-14_itlas']);
        $this->insert('{{%manufacturer}}',['id'=>'24','title'=>'Linea Cali','alias'=>'Linea-Cali','imageID'=>'5644','body'=>'<p>Фабрика Linea cali  основана в 1986 году  господином Валле Саббиа (Valle Sabbia) и является одной из ведущих итальянских компаний, производящих дверные и оконные ручки.</p>
<div> </div>
<div>Фабрика создает ручки, которые, благодаря инновационному креплению и защитным технологиям, таким как циркониевое защитное покрытие (PVD), выдержат все: износ, удары и время.</div>
<div> </div>
